import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonList, IonItem, IonText, IonAvatar, IonLabel } from '@ionic/react';
import ExploreContainer from '../components/ExploreContainer';
import './Tab1.css';

const arr = [
  {
    name: 'Hoang',
    desc: 'I love all things design!'
  },
  {
    name: 'Priya',
    desc: 'Looking for a coding buddy :)'
  },
  {
    name: 'Alex',
    desc: 'Hello :)'
  }
]

const Tab1: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>my matches</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <IonList>
          {arr.map(elem => (
            <IonItem key={elem.name}>
              <IonAvatar>
              <img src="https://ca.slack-edge.com/T0171J44GNS-U01817EKK6E-a04444b7a86c-512" />
              </IonAvatar>
              <IonLabel>
                  <h2>{elem.name}</h2>
                  <p>{elem.desc}</p>
              </IonLabel>
            </IonItem>
          ))}

        </IonList>
      </IonContent>
    </IonPage>
  );
};

export default Tab1;
